import React from "react";
import {Text, View} from 'react-native'
import {ListItem} from "react-native-elements";


const SellersList = sellers => {
    const sellerList = sellers.sellers;
    if (sellerList && sellerList.length > 0){
        return (
            <View>
                {sellerList.map((seller) => (
                    <ListItem title={seller.name} subtitle={seller.city} key={seller.uid}/>
                ))}
            </View>
        )
    }
    else {
        return(<View style={{alignItems: "center", paddingVertical: 50}}><Text>No records found.</Text></View>)
    }


};

export default SellersList;
